        \ direction.\n  - DESCENDING: Threshold is crossed in descending direction.\n\
        \  - CROSSED: Threshold is crossed either in ascending or descending direction.\n"
    NwdafFailureCode:
      anyOf:
      - $ref: '#/components/schemas/NwdafFailureCode_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n  - UNAVAILABLE_DATA: Indicates the requested\
        \ statistics information for the event is rejected since necessary data to\
        \ perform the service is unavailable.\n  - BOTH_STAT_PRED_NOT_ALLOWED: Indicates\
        \ the requested analysis information for the event is rejected since the start\
        \ time is in the past and the end time is in the future, which means the NF\
        \ service consumer requested both statistics and prediction for the analytics.\n\
        \  - UNSATISFIED_REQUESTED_ANALYTICS_TIME: Indicates that the requested event\
        \ is rejected since the analytics information is not ready when the time indicated\
        \ by the \"timeAnaNeeded\" attribute (as provided during the creation or modification\
        \ of subscription) is reached.\n  - OTHER: Indicates the requested analysis\
        \ information for the event is rejected due to other reasons. \n"
    AnalyticsMetadata:
      anyOf:
      - $ref: '#/components/schemas/AnalyticsMetadata_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n  - NUM_OF_SAMPLES: Number of data samples\
        \ used for the generation of the output analytics.\n  - DATA_WINDOW: Data\
        \ time window of the data samples.\n  - DATA_STAT_PROPS: Dataset statistical\
        \ properties of the data used to generate the analytics.\n  - STRATEGY: Output\
        \ strategy used for the reporting of the analytics.\n  - ACCURACY: Level of\
        \ accuracy reached for the analytics.\n"
    DatasetStatisticalProperty:
      anyOf:
      - $ref: '#/components/schemas/DatasetStatisticalProperty_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n  - UNIFORM_DIST_DATA: Indicates the use\
        \ of data samples that are uniformly distributed according to the different\
        \ aspects of the requested analytics.\n  - NO_OUTLIERS: Indicates that the\
        \ data samples shall disregard data samples that are at the extreme boundaries\
        \ of the value range.\n"
    OutputStrategy:
      anyOf:
      - $ref: '#/components/schemas/OutputStrategy_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n  - BINARY: Indicates that the analytics\
        \ shall only be reported when the requested level of accuracy is reached within\
        \ a cycle of periodic notification.\n  - GRADIENT: Indicates that the analytics\
        \ shall be reported according with the periodicity irrespective of whether\
        \ the requested level of accuracy has been reached or not.\n"
    TransferRequestType:
      anyOf:
      - $ref: '#/components/schemas/TransferRequestType_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are - PREPARE: Indicates that the request is for\
        \ analytics subscription transfer preparation. - TRANSFER: Indicates that\
        \ the request is for analytics subscription transfer execution.\n"
    AnalyticsSubset:
      anyOf:
      - $ref: '#/components/schemas/AnalyticsSubset_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n  - NUM_OF_UE_REG: The number of UE registered.\
        \ This value is only applicable to NSI_LOAD_LEVEL event, SLICE_LOAD_LEVEL\
        \ event and LOAD_LEVEL_INFORMATION event.\n  - NUM_OF_PDU_SESS_ESTBL: The\
        \ number of PDU sessions established. This value is only applicable to NSI_LOAD_LEVEL\
        \ event, SLICE_LOAD_LEVEL event and LOAD_LEVEL_INFORMATION event.\n  - RES_USAGE:\
        \ The current usage of the virtual resources assigned to the NF instances\
        \ belonging to a particular network slice instance. This value is only applicable\
        \ to NSI_LOAD_LEVEL event.\n  - NUM_OF_EXCEED_RES_USAGE_LOAD_LEVEL_THR: The\
        \ number of times the resource usage threshold of the network slice instance\
        \ is reached or exceeded if a threshold value is provided by the consumer.\
        \ This value is only applicable to NSI_LOAD_LEVEL event.\n  - PERIOD_OF_EXCEED_RES_USAGE_LOAD_LEVEL_THR:\
        \ The time interval between each time the threshold being met or exceeded\
        \ on the network slice (instance). This value is only applicable to NSI_LOAD_LEVEL\
        \ event.\n  - EXCEED_LOAD_LEVEL_THR_IND: Whether the Load Level Threshold\
        \ is met or exceeded by the statistics value. This value is only applicable\
        \ to NSI_LOAD_LEVEL event, SLICE_LOAD_LEVEL event and LOAD_LEVEL_INFORMATION\
        \ event.\n  - LIST_OF_TOP_APP_UL: The list of applications that contribute\
        \ the most to the traffic in the UL direction. This value is only applicable\
        \ to USER_DATA_CONGESTION event.\n  - LIST_OF_TOP_APP_DL: The list of applications\
        \ that contribute the most to the traffic in the DL direction. This value\
        \ is only applicable to USER_DATA_CONGESTION event.\n  - NF_STATUS: The availability\
        \ status of the NF on the Analytics target period, expressed as a percentage\
        \ of time per status value (registered, suspended, undiscoverable). This value\
        \ is only applicable to NF_LOAD event.\n  - NF_RESOURCE_USAGE: The average\
        \ usage of assigned resources (CPU, memory, storage). This value is only applicable\
        \ to NF_LOAD event.\n  - NF_LOAD: The average load of the NF instance over\
        \ the Analytics target period. This value is only applicable to NF_LOAD event.\n\
        \  - NF_PEAK_LOAD: The maximum load of the NF instance over the Analytics\
        \ target period. This value is only applicable to NF_LOAD event.\n  - DISPER_AMOUNT:\
        \ Indicates the dispersion amount of the reported data volume or transaction\
        \ dispersion type. This value is only applicable to DISPERSION event.\n  -\
        \ DISPER_CLASS: Indicates the dispersion mobility class: fixed, camper, traveller\
        \ upon set its usage threshold, and/or the top-heavy class upon set its percentile\
        \ rating threshold. This value is only applicable to DISPERSION event.\n \
        \ - RANKING: Data/transaction usage ranking high (i.e.value 1), medium (2)\
        \ or low (3). This value is only applicable to DISPERSION event.\n  - PERCENTILE_RANKING:\
        \ Percentile ranking of the target UE in the Cumulative Distribution Function\
        \ of data usage for the population of all UEs. This value is only applicable\
        \ to DISPERSION event.\n  - RSSI: Indicated the RSSI in the unit of dBm. This\
        \ value is only applicable to WLAN_PERFORMANCE event.\n  - RTT: Indicates\
        \ the RTT in the unit of millisecond. This value is only applicable to WLAN_PERFORMANCE\
        \ event.\n  - TRAFFIC_INFO: Traffic information including UL/DL data rate\
        \ and/or Traffic volume. This value is only applicable to WLAN_PERFORMANCE\
        \ event.\n  - NUMBER_OF_UES: Number of UEs observed for the SSID. This value\
        \ is only applicable to WLAN_PERFORMANCE event.\n  - APP_LIST_FOR_UE_COMM:\
        \ The analytics of the application list used by UE. This value is only applicable\
        \ to UE_COMM event.\n  - N4_SESS_INACT_TIMER_FOR_UE_COMM: The N4 Session inactivity\
        \ timer. This value is only applicable to UE_COMM event.\n  - AVG_TRAFFIC_RATE:\
        \ Indicates average traffic rate. This value is only applicable to DN_PERFORMANCE\
        \ event.\n  - MAX_TRAFFIC_RATE: Indicates maximum traffic rate. This value\
        \ is only applicable to DN_PERFORMANCE event.\n  - AVG_PACKET_DELAY: Indicates\
        \ average Packet Delay. This value is only applicable to DN_PERFORMANCE event.\n\
        \  - MAX_PACKET_DELAY: Indicates maximum Packet Delay. This value is only\
        \ applicable to DN_PERFORMANCE event.\n  - AVG_PACKET_LOSS_RATE: Indicates\
        \ average Loss Rate. This value is only applicable to DN_PERFORMANCE event.\n"
    DispersionType:
      description: "Possible values are\n  - DVDA: Data Volume Dispersion Analytics.\n\
        \  - TDA: Transactions Dispersion Analytics.\n  - DVDA_AND_TDA: Data Volume\
        \ Dispersion Analytics and Transactions Dispersion Analytics.\n"
      oneOf:
      - $ref: '#/components/schemas/DispersionType_oneOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
    DispersionClass:
      description: "Possible values are\n  - FIXED: Dispersion class as fixed UE its\
        \ data or transaction usage at a location or a slice, is higher than its class\
        \ threshold set for its all data or transaction usage.\n  - CAMPER: Dispersion\
        \ class as camper UE, its data or transaction usage at a location or a slice,\
        \ is higher than its class threshold and lower than the fixed class threshold\
        \ set for its all data or transaction usage..\n  - TRAVELLER: Dispersion class\
        \ as traveller UE, its data or transaction usage at a location or a slice,\
        \ is lower than the camper class threshold set for its all data or transaction\
        \ usage.\n  - TOP_HEAVY: Dispersion class as Top_Heavy UE, who's dispersion\
        \ percentile rating at a location or a slice, is higher than its class threshold.\n"
      oneOf:
      - $ref: '#/components/schemas/DispersionClass_oneOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
    DispersionOrderingCriterion:
      anyOf:
      - $ref: '#/components/schemas/DispersionOrderingCriterion_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n  - TIME_SLOT_START: Indicates the order\
        \ of time slot start.\n  - DISPERSION: Indicates the order of data/transaction\
        \ dispersion.\n  - CLASSIFICATION: Indicates the order of data/transaction\
        \ classification.\n  - RANKING: Indicates the order of data/transaction ranking.\n\
