    IpAddr:
      description: Contains an IP adresse.
      example:
        ipv6Addr: 2001:db8:85a3::8a2e:370:7334
        ipv4Addr: 198.51.100.1
        ipv6Prefix: 2001:db8:abcd:12::0/64
      oneOf:
      - required:
        - ipv4Addr
      - required:
        - ipv6Addr
      - required:
        - ipv6Prefix
      properties:
        ipv4Addr:
          description: String identifying a IPv4 address formatted in the 'dotted
            decimal' notation as defined in RFC 1166.
          example: 198.51.100.1
          pattern: "^(([0-9]|[1-9][0-9]|1[0-9][0-9]|2[0-4][0-9]|25[0-5])\\.){3}([0-9]|[1-9][0-9]|1[0-9][0-9]|2[0-4][0-9]|25[0-5])$"
          type: string
        ipv6Addr:
          $ref: '#/components/schemas/Ipv6Addr'
        ipv6Prefix:
          $ref: '#/components/schemas/Ipv6Prefix'
      type: object
    Ipv6Prefix:
      allOf:
      - pattern: "^((:|(0?|([1-9a-f][0-9a-f]{0,3}))):)((0?|([1-9a-f][0-9a-f]{0,3})):){0,6}(:|(0?|([1-9a-f][0-9a-f]{0,3})))(\\\
          /(([0-9])|([0-9]{2})|(1[0-1][0-9])|(12[0-8])))$"
      - pattern: "^((([^:]+:){7}([^:]+))|((([^:]+:)*[^:]+)?::(([^:]+:)*[^:]+)?))(\\\
          /.+)$"
      description: String identifying an IPv6 address prefix formatted according to
        clause 4 of RFC 5952. IPv6Prefix data type may contain an individual /128
        IPv6 address.
      example: 2001:db8:abcd:12::0/64
      type: string
    DayOfWeek_1:
      description: "integer between and including 1 and 7 denoting a weekday. 1 shall\
        \ indicate Monday, and the subsequent weekdays shall be indicated with the\
        \ next higher numbers. 7 shall indicate Sunday."
      maximum: 7
      minimum: 1
      type: integer
    TimeOfDay_1:
      description: "String with format partial-time or full-time as defined in subclause\
        \ 5.6 of IETF RFC 3339. Examples, 20:15:00, 20:15:00-08:00 (for 8 hours behind\
        \ UTC)."
      type: string
    MacAddr48:
      description: String identifying a MAC address formatted in the hexadecimal notation
        according to clause 1.1 and clause 2.1 of RFC 7042
      pattern: "^([0-9a-fA-F]{2})((-[0-9a-fA-F]{2}){5})$"
      type: string
    FlowDirection:
      anyOf:
      - $ref: '#/components/schemas/FlowDirection_anyOf'
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are\n- DOWNLINK: The corresponding filter applies\
        \ for traffic to the UE.\n- UPLINK: The corresponding filter applies for traffic\
        \ from the UE.\n- BIDIRECTIONAL: The corresponding filter applies for traffic\
        \ both to and from the UE.\n- UNSPECIFIED: The corresponding filter applies\
        \ for traffic to the UE (downlink), but has no specific direction declared.\
        \ The service data flow detection shall apply the filter for uplink traffic\
        \ as if the filter was bidirectional. The PCF shall not use the value UNSPECIFIED\
        \ in filters created by the network in NW-initiated procedures. The PCF shall\
        \ only include the value UNSPECIFIED in filters in UE-initiated procedures\
        \ if the same value is received from the SMF.\n"
    Fqdn_1:
      description: Fully Qualified Domain Name
      type: string
    PlmnIdNid:
      description: "Contains the serving core network operator PLMN ID and, for an\
        \ SNPN, the NID that together with the PLMN ID identifies the SNPN."
      properties:
        mcc:
          description: "Mobile Country Code part of the PLMN, comprising 3 digits,\
            \ as defined in clause 9.3.3.5 of 3GPP TS 38.413."
          pattern: "^\\d{3}$"
          type: string
        mnc:
          description: "Mobile Network Code part of the PLMN, comprising 2 or 3 digits,\
            \ as defined in clause 9.3.3.5 of 3GPP TS 38.413."
          pattern: "^\\d{2,3}$"
          type: string
        nid:
          description: "This represents the Network Identifier, which together with\
            \ a PLMN ID is used to identify an SNPN (see 3GPP TS 23.003 and 3GPP TS\
            \ 23.501 clause 5.30.2.1)."
          pattern: "^[A-Fa-f0-9]{11}$"
          type: string
      required:
      - mcc
      - mnc
      type: object
    NfServiceSetId:
      description: "NF Service Set Identifier (see clause 28.12 of 3GPP TS 23.003)\
        \ formatted as the following  string  \" set<Set ID>.sn<Service Name>.nfi<NF\
        \ Instance ID>.5gc.mnc<MNC>.mcc<MCC>\">\", or  \"set<SetID>.sn<ServiceName>.nfi<NFInstanceID>.5gc.nid<NID>.mnc<MNC>.mcc<MCC>\"\
        \ with <MCC>  encoded as defined in clause 5.4.2 (\"Mcc\" data type definition)\
        \  <MNC> encoded as defined in  clause 5.4.2 (\"Mnc\" data type definition)\
        \  <NID> encoded as defined in clause\_5.4.2 (\"Nid\"  data type definition)\
        \ <NFInstanceId> encoded as defined in clause 5.3.2 <ServiceName> encoded\
        \  as defined in 3GPP TS 29.510 <Set ID> encoded as a string of characters\
        \ consisting of  alphabetic characters (A-Z and a-z), digits (0-9) and/or\
        \ the hyphen (-) and that shall end  with either an alphabetic character or\
        \ a digit.\n"
      type: string
